import SHOP_DATA from './shop.data';

const INITIAL_DATA = {
    collections: SHOP_DATA
};


const shopReducer = (stte = INITIAL_DATA, action) => {
    switch (action.type) {
        default:
            return stte;
    }
};

export default shopReducer;
